import React, { useState } from 'react'
import "./WeatherStyle/style.css"

const Weather = () => {


  const [date, setDate] = useState({title: "woefweif"})

  return (
    <div className="weather">
      {
        date.map((value) => {
          <h2>{value.title}</h2>
        })
      }
    </div>
  )
}

export default Weather
